create database vcfData;
use vcfData;

CREATE TABLE malignant_data(
	chrom	VARCHAR(5),
	pos	INTEGER,
	id	VARCHAR(35),
	REF	VARCHAR(30),
	alt	VARCHAR(30),
	qual	FLOAT(50),
	filter	VARCHAR(20),
	freq	FLOAT(50)
	);
	
CREATE TABLE benign_data(
	chrom	VARCHAR(5),
	pos	INTEGER,
	id	VARCHAR(25),
	alt	VARCHAR(30),
	REF	VARCHAR(30)
	);



	;
